import React from 'react';
import ReactDOM from 'react-dom';
import Card from './List';
import Para from './Para';



ReactDOM.render(  <>
{
    Para.map( function hi(val){
      return 
     ( <Card 
  imgsrc={val.imgsrc}
  title = {val.title}
  sname={val.sname}
  link={val.link}
  />);
    })             


}
  </>
  , document.getElementById('root')
);
